commits.content:
header {
    height: 100vh;
    padding-top: 7rem;
    overflow: hidden;
}

.header__container{
    text-align: center;
    height: 100%;
    position: relative;
}

/* CTA  */

.cta{
    margin-top: 2.5rem;
    display: flex;
    gap: 1.2rem;
    justify-content: center;
}

/* Redes sociales Header  */

.header__socials {
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 0.8rem;
    position: absolute;
    left: 0;
    bottom: 3rem;
}

.header__socials::after {
    content: "";
    width: 1px;
    height: 2rem;
    background: var(--color-primary) ;
}

/* YO */

.me{
    background: linear-gradient(var(--color-primary), transparent);
    width: 22rem;
    height: 32rem;
    position: absolute;
    left: calc(50% - 11rem);
    margin-top: 4rem;
    border-radius: 12rem 12rem 0 0;
    overflow: hidden;
    padding: 5rem 1.5rem 1.5rem 1.5rem;
}



.scroll__down {
    position: absolute;
    right: -2.3rem;
    bottom: 2rem;
    transform: rotate(90deg);
    font-weight: 300;
    font-size: 0.9rem;
}


/* Queries para convertir en responsives dispositivos medianos (TABLETS)  */

@media screen and (max-width: 1024px)  {

    header {
        height: 100vh;
    }
}


    
/* Queries para convertir en responsives dispositivos pequeños (Telefonos)  */

@media screen and (max-width: 600px)  {
    header {
        height: 130vh;
    }
    
    .header__socials,
    .scroll__down{
        display: none;
    }
}
